import form  from './form';

export default class Main extends Component {
    render() {

        const {currentNote} = this.props
       
            if(!currentNote) {
                return (
                <div className="main">
                    <p>No Active Notes</p>
                </div>
                )
            } else {
                return (
                    <form />
                )
            }
           
        
    }
}
